import React, { useState } from 'react';
import { Popover, Typography } from '@mui/material';
import santosh from '../Assets/santosh.jpg';

function Navbar() {
    const [anchorEl, setAnchorEl] = useState(null);
    const [isPopup, setIsPopup] = useState(false);
    const [isOpen, setIsOpen] = useState(false); // For custom toggle
    const user = true;

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
        setIsPopup(true);
    };

    const handleClose = () => {
        setAnchorEl(null);
        setIsPopup(false);
    };

    const handleToggle = () => {
        setIsOpen(!isOpen);
    };

    const id = isPopup ? 'simple-popover' : undefined;

    // Internal CSS styles
    const styles = {
        toggleWrapper: {
            display: 'none', // Hidden by default
        },
        toggle: {
            position: 'relative',
            width: '60px',
            height: '60px',
            cursor: 'pointer',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            gap: '12px',
            transitionDuration: '.5s',
        },
        bars: {
            width: '100%',
            height: '6px',
            backgroundColor: 'rgb(92, 176, 255)',
            borderRadius: '6px',
        },
        bar4: {
            width: '80%',
        },
        bar5: {
            width: '80%',
            transitionDuration: '.8s',
        },
        bar6: {
            width: '80%',
        },
        checkedToggleWrapper: {
            display: 'flex',
        },
        checkedBar5: {
            transform: 'scaleX(0)',
            transitionDuration: '.5s',
        },
        checkedBar4: {
            transform: 'rotate(45deg)',
            transitionDuration: '.5s',
        },
        checkedBar6: {
            transform: 'rotate(-45deg)',
            transitionDuration: '.5s',
        },
        checkedToggle: {
            transform: 'rotate(180deg)',
            transitionDuration: '.5s',
        },
    };

    return (
        <div className='container'>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">Navbar</a>
                    <div className="d-lg-none">
                        <input 
                            id="checkbox2" 
                            type="checkbox" 
                            checked={isOpen}
                            onChange={handleToggle} 
                            style={{ display: 'none' }} // Hide the actual checkbox
                        />
                        <label 
                            className="toggle" 
                            htmlFor="checkbox2" 
                            style={isOpen ? { ...styles.toggle, ...styles.checkedToggle } : styles.toggle}
                        >
                            <div 
                                id="bar4" 
                                className="bars" 
                                style={isOpen ? { ...styles.bars, ...styles.checkedBar4 } : styles.bar4}
                            ></div>
                            <div 
                                id="bar5" 
                                className="bars" 
                                style={isOpen ? { ...styles.bars, ...styles.checkedBar5 } : styles.bar5}
                            ></div>
                            <div 
                                id="bar6" 
                                className="bars" 
                                style={isOpen ? { ...styles.bars, ...styles.checkedBar6 } : styles.bar6}
                            ></div>
                        </label>
                    </div>
                    <button className="navbar-toggler d-none" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className={`collapse navbar-collapse${isOpen ? ' show' : ''}`} id="navbarNav">
                        <ul className="navbar-nav ms-auto d-flex gap-4 pe-5">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link active" href="#">Jobs</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link active" href="#">Applications</a>
                            </li>
                        </ul>
                        {!user ? (
                            <div className='d-flex gap-4'>
                                <button className='btn btn-md bg-info'>Log In</button>
                                <button className='btn btn-md bg-secondary text-white'>Sign Up</button>
                            </div>
                        ) : (
                            <div>
                                <img 
                                    src={santosh} 
                                    alt="User" 
                                    className='rounded-circle' 
                                    style={{ width: "40px", height: "40px" }} 
                                    aria-describedby={id} 
                                    onClick={handleClick} 
                                />
                                <Popover
                                    id={id}
                                    open={isPopup}
                                    anchorEl={anchorEl}
                                    onClose={handleClose}
                                    anchorOrigin={{
                                        vertical: 'bottom',
                                        horizontal: 'left',
                                    }}
                                >
                                    <Typography sx={{ p: 2 }}>The content of the Popover.</Typography>
                                </Popover>
                            </div>
                        )}
                    </div>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
